import React from 'react';

const Logout: React.FC = () => {
  const handleLogout = () => {
    localStorage.removeItem('token');
    window.location.reload(); // Reload page to trigger re-render
  };

  return (
    <button onClick={handleLogout}>
      Logout
    </button>
  );
};

export default Logout;
